    false,nt"url": null,nt"notes": "Data and information collected by the submersible
    Johnson Sea-Link II at waypoints along its track during one dive of the 2002 "Islands
    in the Stream - Deep Reef Habitat" expedition sponsored by the National Oceanic
    and Atmospheric Administration (NOAA) Office of Ocean Exploration, July 28 through
    August 5, 2002. Measurements and information include sub's position and depth; personnel
    assignments; dive, mission, target, and vehicle ID's; dive comments; hyperlinks
    to CTD plots; water temperature; and salinity. The Marine Operations Division of
    the Harbor Branch Oceanographic Institution provided the original submersible data.
    Quality assurance included a comparsion and synchronization of dive log waypoint
    depths and CTD depths, review of minimum and maximum values, and deletion of bad
    values.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
